import './App.css';
import TabPanel from './Tabs';
import ButtonAdd from './Button';

function AddSpace (){
  return(
    <div>
      <input type="text" id="What needs to de done?" placeholder ="search" />
    </div>
  );
}





function App() {
  return (
    <div className="App">
      <h1>TODO LIST</h1>
      <ButtonAdd/>
      <TabPanel/>
    </div>
  );
}

export default App;
